script:
const size = 32;
const origin = { x: -16, z: -16 };
const center = size * 0.5 - 0.5;

reset();

box(
  origin.x, 0, origin.z - size,
  size, size, size,
  3
);
box(
  origin.x - 1, 0, origin.z,
  size + 2, size + 1, size,
  3
);
box(
  origin.x, 1, origin.z,
  size, size - 1, size,
  1
);
box(
  origin.x, 0, origin.z + size,
  size, size, size,
  3
);

const radius = size * 0.45;
for (let z = -size; z < size * 2; z += 1) {
  let t = (z < 0 || z > size - 1) ? 4 : 2;
  if (z % size === 0) {
    update(origin.x + 1, center + 0.5, origin.z + z, 0);
    update(origin.x, center + 0.5, origin.z + z, t);
  }
  if ((z + size * 0.5) % size === 0) {
    update(origin.x + size - 2, center + 0.5, origin.z + z, 0);
    update(origin.x + size - 1, center + 0.5, origin.z + z, t);
  }
  for (let y = 0; y < size; y += 1) {
    for (let x = 0; x < size; x += 1) {
      if (Math.sqrt((x - center) ** 2 + (y - center) ** 2) < radius) {
      	update(origin.x + x, y, origin.z + z, 0);
      }  
    }  
  }
}

box(
  origin.x + size - 1,
  center + 0.5 - 7,
  origin.z + size * 0.5 - 5,
  5, 14, 10,
  3
);
box(
  origin.x + size - 7,
  center + 0.5 - 6,
  origin.z + size * 0.5 - 4,
  10, 12, 8,
  1
);
box(
  origin.x + size - 7,
  center + 0.5 - 5,
  origin.z + size * 0.5 - 3,
  9, 10, 6,
  0
);

for (let j = 0; j < 2; j += 1) {
   box(
    origin.x + size - 6,
    center + 0.5 - 4,
    origin.z + size * 0.5 + (j === 0 ? 3 : -4),
    4, 4, 1,
    5
  );
  box(
    origin.x + size - 6,
    center + 0.5 + 1,
    origin.z + size * 0.5 + (j === 0 ? 3 : -4),
    4, 3, 1,
    5
  );
  update(
    origin.x + size - 1,
    center + 0.5,
    origin.z + size * 0.5 + (j === 0 ? 3 : -4),
    0
  );
  update(
    origin.x + size - 1,
    center + 0.5,
    origin.z + size * 0.5 + (j === 0 ? 4 : -5),
    2
  );
}

box(
  origin.x + size + 2,
  center + 0.5 - 5,
  origin.z + size * 0.5 - 2,
  1, 8, 4,
  0
);
